  padding: 20px;
}
.markdown a {
  text-decoration: none;
  vertical-align: baseline;
}
.markdown a:hover {
  text-decoration: underline;
}
.markdown h1 {
  font-size: 2.2em;
  font-weight: bold;
  margin: 1.5em 0 1em 0;
}
.markdown h2 {
  font-size: 1.8em;
  font-weight: bold;
  margin: 1.275em 0 0.85em 0;
}
.markdown h3 {
  font-size: 1.6em;
  font-weight: bold;
  margin: 1.125em 0 0.75em 0;
}
.markdown h4 {
  font-size: 1.4em;
  font-weight: bold;
  margin: 0.99em 0 0.66em 0;
}
.markdown h5 {
  font-size: 1.2em;
  font-weight: bold;
  margin: 0.855em 0 0.57em 0;
}
.markdown h6 {
  font-size: 1em;
  font-weight: bold;
  margin: 0.75em 0 0.5em 0;
}
.markdown h1:first-child,
.markdown h2:first-child,
.markdown h3:first-child,
.markdown h4:first-child,
.markdown h5:first-child,
.markdown h6:first-child {
  margin-top: 0;
}
.markdown h1 + p,
.markdown h2 + p,
.markdown h3 + p,
.markdown h4 + p,
.markdown h5 + p,
.markdown h6 + p {
  margin-top: 0;
}
.markdown hr {
  border: 1px solid #cccccc;
}
.markdown p {
  margin: 1em 0;
  word-wrap: break-word;
}
.markdown ol {
  list-style-type: decimal;
}
.markdown li {
  display: list-item;
  line-height: 1.4em;
}
.markdown blockquote {
  margin: 1em 20px;
}
.markdown blockquote > :first-child {
  margin-top: 0;
}
