  margin-bottom: 0;
}
.markdown blockquote cite:before {
  content: '\2014 \00A0';
}
.markdown .code {
  border-radius: 3px;
  word-wrap: break-word;
}
.markdown pre {
  border-radius: 3px;
  word-wrap: break-word;
  border: 1px solid #cccccc;
  overflow: auto;
  padding: .5em;
}
.markdown pre code {
  border: 0;
  display: block;
}

.markdown pre > code {
  font-family: 'Fira Code', 'Ubuntu Mono', 'Droid Sans Mono', 'Operator Mono', 'Liberation Mono', 'Source Code Pro', Menlo, Consolas, Courier, monospace;
